import React from "react";
import TextField from "@mui/material/TextField";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import DatePicker from "@mui/lab/DatePicker";

export default function DatePickersWithTitle(props) {
  return (
    <div className="environmental-modules">
      <div className="environmental-modules-title">{props.title}</div>
      <LocalizationProvider dateAdapter={AdapterDateFns}>
        <div style={{ border: "1px solid red", padding: "10px" }}>
          <DatePicker
            value={new Date()} // Set a default value for testing
            onChange={(date) => console.log(date)} // Add a change handler for testing
            renderInput={(params) => <input {...params} />}
          />
        </div>
        <DatePicker
          label="End Date"
          value={props.endDate}
          onChange={(newValue) => {
            props.setEndDate(newValue);
          }}
          renderInput={(params) => <TextField {...params} />}
        />
      </LocalizationProvider>
      <button className="download-button">Download</button>
    </div>
  );
}
